I have a Tooltip component that I want to use in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips are isolated from each other and don't have a shared scope, I'm thinking of using React Context to manage their state.

Here's a basic structure of what I have so far:

